package day_3_23;

public class Logical_operator {
// &&, ||, !=
	public static void main(String[] args) {
		// TODO Auto-generated method stub
  int a=10;
  int b=20;
  int c=5;
  int d=20;
  
  System.out.println(c<a &&  c<b);
  System.out.println(c<a || c<b); 
  System.out.println(b!=a);
  System.out.println(b!=d);
  
	}

}
